import './Chart.css';
import ChartBar from './ChartBar';

export default function Chart(props){
  return (
  <div className='chart'>
    {props.dataPoints.map(dataPoint => <ChartBar key={dataPoint.label} value={dataPoint.value} label={dataPoint.label}/>)}

  </div>
  )
}
